var colors = [ "blue", "green", "yellow", "coral", "gray", "pink"]
var lightcolors = colors.map((c) => "light" + c)

function updateFirstLast() {
	var prev = -1
	for (var i = 0; i < images.length; i++) {
	  // console.log(images[i])
	  images[i].id = i
	  images[i].first = images[i].event_id!=prev
	  prev = images[i].event_id
	}
	var next = -1;
	for (var i = images.length - 1; i >= 0; i--) {
	  images[i].last = images[i].event_id!=next
	  next = images[i].event_id
	}
}
updateFirstLast()
