class ImageSVG extends Component {
	render() {
		return (
			<svg width="100" height="30">
			  { 
			    (this.props.last || this.props.first) && !(this.props.last && this.props.first) ? 
			      ( this.props.first ?
			        <rect width="55" height="5" x="55" y="12.5" fill={this.props.col}></rect> : 
			        <rect width="55" height="5" x="0" y="12.5" fill={this.props.col}></rect>
			      ) : null
			  }
			  { this.props.last || this.props.first ? <circle cx={50} cy={15} r={10} className="circle" stroke={this.props.col} /> : null}
			  {(!this.props.last && !this.props.first) ? <rect width="110" height="5" x="0" y="12.5" fill={this.props.col}></rect> : null }

			</svg>
		)
	}
}

