    this.handleInfiniteLoad = this.handleInfiniteLoad.bind(this)
    this.buildElements = this.buildElements.bind(this)
    this.state = {
    	isInfiniteLoading: false,
    	itemHeight: 180/4,
    	itemHeightReal: 180,
    	dragging:false,
    	draggingStart:null,
    	draggingEnd:null
    }
